        if S_AC == '<':
            if S_BC == '<':
                order = ['C', 'B', 'A']
            elif S_BC == '>':
                order = ['B', 'C', 'A']
        elif S_AC == '>':
            if S_BC == '<':
                order = ['B', 'A', 'C']
            elif S_BC == '>':
                order = ['C', 'A', 'B']

    # The middle brother is the second oldest
    middle_brother = order[1]
    print(middle_brother)

