def countValidSubstrings(s: str, k: int) -> int:
    def atMostKOnes(substring: str, k: int) -> bool:
        return substring.count('1') <= k

    n = len(s)
    total_count = 0

    for i in range(n):
        ones_count = 0
        for j in range(i, n):
            if s[j] == '1':
                ones_count += 1
            if ones_count > k:
                break
            if atMostKOnes(s[i:j+1], k):
                total_count += 1

    return total_count

